import React, {useEffect} from 'react';

import Tmdb from './Tmdb';

export default () => {

    useEffect(() => {
        const loadAll = async () => {
            // Captura a lsita total
            let list = await Tmdb.getHomeList();
            console.log(list);
        }

        loadAll();
    }, []);

    return(
        <div>Hello World!</div>
    );
}
